import "./App.css";
import Blog from "./components/page/blog";
import "bootstrap/dist/css/bootstrap.min.css";
import Routess from "./router";

function App() {
  return (
    <>
      <Routess />
      <div className="App">
        <br />
        <br />
        <Blog />
      </div>
    </>
  );
}

export default App;
